import React from 'react';
import '../styles.css';
import Footer from './Footer';


class Products extends React.Component {
    render() {
        return (
            <div className="productsPage">
                <h2>Products Page</h2>
                <div class="card" style={{width : '18rem'}}>
                    <div class="work-img">
                        <a href="Shop_Mens"><img class="card-img-top img-fluid" src="https://www.pacsun.com/dw/image/v2/AAJE_PRD/on/demandware.static/-/Sites-pacsun_storefront_catalog/default/dwffe516c2/product_images/0097503380408NEW_00_054.jpg?sw=690&sh=1070&sm=fit" alt="pacsun huf shirt"/></a>
                        <div class="img-overlay"></div>
                    </div>
                    <div class="card-body">
                        <p>HUF Alameda Striped T-Shirt</p>
                        <ul class="card-text">
                            <li>$35</li>
                            <li>This rad tee has a classic everyday construction, bold multicolor stripes all over, and an embroidered HUF logo at the left chest.</li>
                        </ul>
                    </div>
                </div>
                <Footer />
            </div>
        );
    }
}
export default Products;
